import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Welcome to the Contest Platform</h1>
      <p>
        This platform allows you to participate in weekly and bi-daily contests, 
        test your skills, and track your performance. Start your journey by logging in or registering.
      </p>
      <div style={{ marginTop: '20px' }}>
        <Link to="/login">
          <button style={{ marginRight: '10px', padding: '10px 20px', cursor: 'pointer' }}>Login</button>
        </Link>
        <Link to="/register">
          <button style={{ padding: '10px 20px', cursor: 'pointer' }}>Register</button>
        </Link>
      </div>
    </div>
  );
};

export default Home;
